        const publicKey: bigInt.BigInteger = BigNumberHelper.fromHexString("");

        const option: PlainTextOption = spoiltBallot.options[0];
        const ciphers: Cipher[] = encryptedBallot.encryptedOptions.filter(eo => eo.shortCode === option.shortCode).flatMap(eo => eo.values.map(v => v.cipher));

        // act
        const isEncryptionCorrect: boolean = option.verifyEncryption(p, g, publicKey, ciphers);

        // assert
        expect(isEncryptionCorrect).toBe(true);
